import React from 'react';
import Logo from './components/logo/logo';
import Searchbar from './components/searchbar/searchbar';
import './App.css';
import Face from './components/face/face'
import Particles from 'react-particles-js';
import reactDom from 'react-dom';


class App extends React.Component{
  constructor(){
    super();
    this.state={
    input:'',
    imageurl:''
    }
  }
  inpchange=(event)=>{
   this.setState({input:event.target.value});
   console.log(this.state.input);
  }
  onbtnclk=()=>{
this.setState({imageurl:this.state.input});
console.log(this.state.imageurl);
  }
  render(){
  return (
    <div>
      <Particles className='particles'
              params={{
            		particles: {
                  number:{
                    value:200,
                  }
            		}
            	}}
            />
      <Logo/>
      <div>
    <div style={{display:'flex',flexDirection:'column',alignItems:'center',border:'2px solid black'}}>
    <p style={{fontStyle:'oblique',fontSize:'1.5em',justifyContent:'center',paddingBottom:'0px',marginBottom:'2px'}} className='grow'>FACE DETECTION APP :)</p>

    <div style={{border:'2px solid black',marginBottom:'5px'}}></div>

    <div className='pa4 dib shadow-4 br3 custom'>
      <Searchbar inpchange={this.inpchange} onbtnclk={this.onbtnclk}/>
     </div>
      <Face url={this.state.imageurl}/>
    </div>
    </div>
    </div>
  );
}
}

export default App;
